from typing import List
class Solution:
    def restoreIpAddress(self, s: str) -> List[str]:
        ips = []
        self.getIP(s,0,"",ips)
        return ips

    def getIP(self, s, index, path, ips):
        if index == 4:
            if not s:
                ips.append(path[:-1])
            return

        for i in range(1,4):
            if i <= len(s):
                if i == 1:
                    self.getIP(s[i:], index+1, path+s[:i]+".", ips)
                elif i == 2 and s[0] != "0":
                    self.getIP(s[i:], index+1, path+s[:i]+".", ips)
                elif i == 3 and s[0] != "0" and int(s[:3]) <= 255:
                    self.getIP(s[i:], index+1, path+s[:i]+".", ips)

s = Solution()

print(s.restoreIpAddress("25525511135"))

print(s.restoreIpAddress(""))
